    enableSyncInterval = ()=>{
        ResultViewController.syncItvId = setInterval(()=>{
    
            let d = new Date()
            let remMin = 9-d.getMinutes()%10
            let remSec = 59-d.getSeconds()%60
            let syncBtn:webix.ui.button = $$(Result.viewIds.syncBtn)

            // syncBtn.define('lable','Data will be synchronized in '+(10-remMin)+' minute(s)')
            // syncBtn.setValue('<span class="webix_icon_btn wxi-sync" style="max-width:32px;"></span> data will be synchronized in '+remMin+':'+remSec)
            syncBtn.setValue('data will be synchronized in '+remMin+':'+remSec)
            if(remMin===0&&remSec===0){

                this.onSyncBtnClick()
            }
        },1000)
    }

    onToggleChange = ()=>{
        let syncTog = $$(Result.viewIds.syncTog)
        let val = syncTog.getValue()

        if(val ==1){
            this.enableSyncInterval()
        }else{
            clearInterval(ResultViewController.syncItvId)
            let syncBtn:webix.ui.button = $$(Result.viewIds.syncBtn)
            syncBtn.setValue('Reload')
        }
    }

    loadTimeAndId= (data)=>{

        ResultViewController.qryConditions = data
        let grpCombo:webix.ui.combo = $$(Result.viewIds.grpCombo)
        let toolgId = grpCombo.getValue()

        let options = alasql("SELECT DISTINCT [value] as id,SUBSTRING(end_time,6) as [value] FROM ? WHERE TOOLG_ID = ? ORDER BY end_time DESC", [data,toolgId])
        let timeCombo:webix.ui.combo = $$(Result.viewIds.timeCombo)

        timeCombo.define("options", options)
        timeCombo.refresh()
        timeCombo.setValue((<any>timeCombo.getList()).getFirstId())
    }

    onGrpComboChange=(newv, oldv)=> {

        //load times & parent id
        mod.getQryCondition(newv,this.loadTimeAndId)
    }

    onTimeComboChange = async (newv, oldv) => {

        let timeCombo:webix.ui.richselect = $$(Result.viewIds.timeCombo)
        let parentId = timeCombo.getValue()
        let lotGrid:webix.ui.datatable = $$(Result.viewIds.lotBody).queryView({ view: "datatable" })
        let maskGrid:webix.ui.datatable = $$(Result.viewIds.maskBody).queryView({ view: "datatable" })

        let grpCombo:webix.ui.combo = $$(Result.viewIds.grpCombo)
        let toolgId = grpCombo.getValue()
        
        if(newv==null){
            gantt.clearAll()
            lotGrid.clearAll()
            maskGrid.clearAll()

            return
        }

        if(parentId!==this.curParentId){

            $$(Result.viewIds.lotGrid).showOverlay("Loading...")

            /*
            mod.getLotGridData(toolgId,parentId,(data) => {

                this.clearFilters()

                //set lot grid data
                lotGrid.clearAll();
                (<any>lotGrid).parse(data);
                lotGrid.refresh();
                lotGrid.hideOverlay()
            });*/

            this.clearFilters()

            //set lot grid data
            lotGrid.clearAll();
            (<any>lotGrid).parse(Data.gridData);
            lotGrid.refresh();
            lotGrid.hideOverlay()

            // execute gantt
            // let rawData = await mod.getLotGantt(`'${parentId}'`)
            this.renderLotGantt(Data.lotData)

            // execute gridview
            mod.getMaskGridData(parentId,(data) => {
                maskGrid.clearAll();
                (<any>maskGrid).parse(data);
                maskGrid.refresh();
            })
        }
    }

