        let clearAllfilter = ()=>{
            let grid:webix.ui.datatable  = $$(Result.viewIds.lotGrid)

            grid.eachColumn(function(id, col){
                var filter = grid.getFilter(id);
                if (filter){
                  if (filter.setValue) filter.setValue("")
                    else filter.value = "";
                }
              })
        }

        //set task click event
        gantt.attachEvent("onTaskClick", function(id){

            clearAllfilter()
            let task = gantt.getTask(id)

            //prevent conflicting with rowclick
            if(task.text==task.parent_text){
                let task = gantt.getTask(id)
                let grid:webix.ui.datatable  = $$(Result.viewIds.lotGrid) 
                let filter = grid.getFilter('TOOL_ID')

                filter.value = task.parent_text

                grid.filterByAll()

                return
            }

            let grid:webix.ui.datatable  = $$(Result.viewIds.lotGrid)
            let toolFilter = grid.getFilter('TOOL_ID')

            toolFilter.value = task.parent_text

            if(task.seq==9994||task.seq==9998){
                let lotFilter = grid.getFilter('SEQ')
                lotFilter.value = task.seq               
            }else{

                let lotFilter = grid.getFilter('LOT_ID')
                lotFilter.value = task.text
            }

            grid.filterByAll()
        });

        gantt.templates.task_class = function (start, end, task) {
            let cls = 'gantt_recipe_'

            if(!task.recipe)
                return "down"

            if(task.jobChg){
                cls += "1"
            }else{
                cls += "0"
            }

            cls += "_lv_"

            if(task.m_level=='L2'){
                cls += '2'
            }else if(task.m_level=='L3'){
                cls += '3'
            }else{
                cls+="n"
            }
            
            return cls
        }

        gantt.attachEvent("onGanttRender", ()=>{
            setTimeout(ResultViewController.setGanttProdInfoText,1000)
            // console.log('gantt render')
        });
